import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Header extends Component {
  state = {
    path: '/',
  };
  userroute = this.state.path == 1;
  render() {
    return <link to={userroute ? '/' : '/resume'}> Ekkawin.V</link>;
  }
}

export default Header;
